export default {
    name:"CourseStatistic",
    props:{
        reviewStatistic:{
            type: Object,
            default: function(){
                return{
                    reveiwCnt:100,
                    content:"10",
                    teaching:"10",
                    grading:"10",
                    workload:"10",
                }
            }
        }
    },
    computed: {
        getRate(){
            return (grade) =>{
                grade = Number(grade)
                if(8 <= grade && grade <= 10){return "rating-5";}
                if(6 <= grade && grade < 8){return "rating-4";}
                if(4 <= grade && grade  < 6){return "rating-3";}
                if(2 <= grade && grade  < 4){return "rating-2";}
                if(0 <= grade && grade < 2){return "rating-1";}
            }
        },
    }
}
